import React from 'react';
import { Row, Col } from 'react-bootstrap'

const Footer = () => {
    return (
        <Row>
            <Col>
                <div className="text-center">
                    <h5>본 페이지는 개인 프로젝트를 위해서 구현되었습니다.</h5>
                </div>
            </Col>
        </Row>
    )
}

export default Footer;
